import React from 'react';
import { Line } from 'react-chartjs-2';
import { Chart as ChartJS } from 'chart.js/auto';

function LineChart({ chartData }) {
	return (
		<div>

			<Line data={chartData} width={300} height={100} />
		</div>
	)};

export default LineChart;
